def apply_smote():
    # File paths
    # "best_acc_prc": "preprocess/impute_missing_values/cleaned/bmi_glu_median_bmi_knn_smoke_k2.xlsx",
    # "best_rec": "preprocess/impute_missing_values/cleaned/bmi_glu_mean_bmi_knn_smoke_k10.xlsx",
    # "best_f1": "preprocess/impute_missing_values/cleaned/bmi_glu_median_bmi_mean_smoke_k7.xlsx",
    input_files = {
        "best_acc_f1_2": "preprocess/impute_missing_values/cleaned/bmi_glu_median_bmi_mean_smoke_k7.xlsx",
        "best_rec_2": "preprocess/impute_missing_values/cleaned/bmi_glu_median_bmi_knn_smoke_k10.xlsx",
        "best_prc_2": "preprocess/impute_missing_values/cleaned/bmi_glu_median_bmi_knn_smoke_k2.xlsx"
    }
    # Output folder
    output_folder = "smote/"
    # Apply SMOTE and save the files
    for name, file_path in input_files.items():
        # Load the dataset
        df = pd.read_excel(file_path)

        # Ensure 'stroke' is the target column
        if 'stroke' not in df.columns:
            print(f"Skipping {file_path} (no 'stroke' column)")
            continue

        # Convert categorical to numerical
        X = df.drop(columns=['stroke'])
        X = pd.get_dummies(X, drop_first=True)  # One-hot encode categorical features
        X = X.astype(float)  # Ensure numeric type
        y = df['stroke']

        # Apply SMOTE
        smote = SMOTE(random_state=42)
        X_resampled, y_resampled = smote.fit_resample(X, y)

        # Convert back to DataFrame
        df_resampled = pd.DataFrame(X_resampled, columns=X.columns)
        df_resampled['stroke'] = y_resampled  # Add target column back

        # Save to Excel
        output_file = os.path.join(output_folder, f"{name}_smote.xlsx")
        df_resampled.to_excel(output_file, index=False)

        print(f"SMOTE applied and saved: {output_file}")


def stratified_split(data):
    # Extract the class labels
    y = data['stroke']

    # Perform stratified split
    train_idx, test_idx = train_test_split(
        data.index,
        test_size=0.2,
        stratify=y,
        random_state=None  # Randomized split
    )
    return train_idx, test_idx


def categorize_test_samples(X_train, y_train, X_test, threshold):
    train_stroke0 = X_train[y_train == 0]
    train_stroke1 = X_train[y_train == 1]
    dist_test_to_stroke0 = np.min(cdist(X_test, train_stroke0), axis=1)
    dist_test_to_stroke1 = np.min(cdist(X_test, train_stroke1), axis=1)
    test_near_stroke0_idx = np.where((dist_test_to_stroke0 < dist_test_to_stroke1) & (dist_test_to_stroke0 < threshold))[0]
    test_near_stroke1_idx = np.where((dist_test_to_stroke1 < dist_test_to_stroke0) & (dist_test_to_stroke1 < threshold))[0]
    test_rest_idx = np.setdiff1d(np.arange(len(X_test)), np.concatenate((test_near_stroke0_idx, test_near_stroke1_idx)))

    return test_near_stroke0_idx, test_near_stroke1_idx, test_rest_idx


