        # print(f'near 1:{len(y_test_near_stroke1)}')
        # print(f'outside threshold:{len(y_test_rest)}')
        # Train the model
        clf.fit(X_train, y_train)
        # Make predictions
        pred_rest = clf.predict(X_test_rest)
        pred_stroke0 = []
        for k in range(0, len(y_test_near_stroke0)):
            pred_stroke0.append(0)
        pred_stroke1 = []
        for k in range(0, len(y_test_near_stroke1)):
            pred_stroke1.append(1)
        # print(len(pred_stroke0))
        # print(len(pred_stroke1))
        # Combine results for this dataset
        y_test_combined = list(y_test_rest) + list(y_test_near_stroke0) + list(y_test_near_stroke1)
        predictions_combined = list(pred_rest) + list(pred_stroke0) + list(pred_stroke1)
