        # Compute specificity
        tn, fp, fn, tp = conf_matrix.ravel()
        specificity = tn / (tn + fp) if (tn + fp) > 0 else 0
        acc = (tn + tp) / (tn + fp + fn + tp)
        pr = tp / (tp + fp)
        rec = tp / (tp + fn)
