def stacking(X_train, X_test, y_train, y_test):
    base_models = [('dt', DecisionTreeClassifier(criterion='entropy')),
                   ('rf', RandomForestClassifier(n_estimators=100, random_state=42)),
                   ('xgb', XGBClassifier(eval_metric='logloss', use_label_encoder=False))]
    stacking_clf = StackingClassifier(estimators=base_models,
                                      final_estimator=XGBClassifier(eval_metric='logloss', use_label_encoder=False))
    stacking_clf.fit(X_train, y_train)
    y_pred = stacking_clf.predict(X_test)
    print(f'acc = {accuracy_score(y_test, y_pred)}')
